On this episode of Nightcap Knowledge, the hosts welcome Tony Hull, the Offensive Coordinator for Grambling State University Football. With years of experience coaching at various levels of football, Hull shares his insights on what it takes to succeed in the sport and how to develop winning strategies. The hosts also discuss the role of football in Black communities, and explore the challenges and opportunities facing historically Black colleges and universities. 

Join DJ George Chuck, Mac Epps, and Tonya Boyd-Cannon tonight at 9PM CT for a lively and informative conversation about football and Black culture!

